import React, { useState, useEffect } from 'react';
import './main.css';
import './components/card.css';
import Card from './components/card';
import Recom from './pages/Recom';
import Search from './pages/Search';
import { Suspense, lazy } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// import Navbar from './components/Navbar';
// import Movie from './pages/Movie';
// import Top_anime from './pages/Top_anime';
// import Pop_anime from './pages/Pop_anime';


// NICE

const Navbar = lazy(() => import('./components/Navbar'));
const Movie = lazy(() => import('./pages/Movie'));
const Pop_anime = lazy(() => import('./pages/Pop_anime'));
const Top_anime = lazy(() => import('./pages/Top_anime'));
function App() {


  return (
    <Router>
      <Suspense fallback={<div>Loading...</div>}>
        <Routes>
          <Route exact path="/" element={<Navbar />} />
          <Route path="/movie" element={Movie} />
          <Route path="/popular" element={Pop_anime} />
          <Route path="/topanime" element={Top_anime} />
        </Routes>
      </Suspense>
    </Router>
  );
}

export default App;
